import { Route, BrowserRouter as Router, Switch } from "react-router-dom";
import MainContainer from "./components/main/mainContainer";
import "fontsource-roboto";
import "./css/main.css";


import Home from "./components/home";

import temp from "./components/main/fileList";


function App() {
  return (
    <div className="App">
      <Router>
        <Home/>
        <Switch>
          <Route path='/main' exact component={MainContainer}></Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
